import styled from "styled-components";

const AllProjectsContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: items;
  margin: 4em 2em 2em 2em;
`;

const SingleJobContainer = styled.span`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: items;
`;

const ProjectDescription = styled.span`
  left-margin: 10px;
`;

const ProjectImg = styled.img`
  width: 30vw;
`;

const Projects = () => {
  return (
    <AllProjectsContainer>
      <h3 style={{ textAlign: "center" }}>REACT NASA IMAGES APP</h3>
      <SingleJobContainer>
        <ProjectImg src="https://www.codingdojo.com/blog/wp-content/uploads/6.jpg" />
        <ProjectDescription>
          <p>
            A search engine for NASA's image library. API endpoint was provided
            as part of the brief. User is able to search for and return relevant
            images. If no relevant images the user will receive a message, "No
            results returned. Please try again." You can see a live deployed
            version of the app by clicking here.
          </p>
        </ProjectDescription>
      </SingleJobContainer>

      <h3 style={{ textAlign: "center" }}>PROJECT NAME</h3>
      <SingleJobContainer>
        <ProjectImg src="https://www.codingdojo.com/blog/wp-content/uploads/6.jpg" />
        <p>
          Brunch raw denim mixtape raclette. Asymmetrical narwhal put a bird on
          it, ennui disrupt chillwave hashtag affogato shaman. Heirloom tilde
